# Caveman-Skeltons

This includes skeltons for [Caveman2](https://github.com/fukamachi/caveman).

***Note: The base skelton (in the master branch) is copied from the original skelton in caveman2.***

## Documentation

(Check if gravizo can be used in github.io)

![Alt text](http://g.gravizo.com/g?
  digraph G {
    aize ="4,4";
    main [shape=box];
    main -> parse [weight=8];
    parse -> execute;
    main -> init [style=dotted];
    main -> cleanup;
    execute -> { make_string; printf};
    init -> make_string;
    edge [color=red];
    main -> printf [style=bold,label="100 times"];
    make_string [label="make a string"];
    node [shape=box,style=filled,color=".7 .3 1.0"];
    execute -> compare;
  }
)

